CREATE DATABASE Aviato;

USE Aviato;

CREATE USER 'webapp'@'%' IDENTIFIED BY 'abc123';

GRANT ALL PRIVILEGES ON cool_db.* TO 'webapp'@'%';

FLUSH PRIVILEGES;


CREATE TABLE User(
    userID INTEGER PRIMARY KEY AUTOINCREMENT,
    gender VARCHAR(255) NOT NULL,
    birthdate VARCHAR(255) NOT NULL,
    firstName VARCHAR(255) NOT NULL,
    lastName VARCHAR(255) NOT NULL,
    phone VARCHAR(255) NOT NULL,
    email VARCHAR(255) NOT NULL,
    pemissions VARCHAR(255) NOT NULL,
    FOREIGN KEY (buyerID) REFERENCES Buyer(buyerID),
    FOREIGN KEY (sellerID) REFERENCES Seller(sellerID)
);

CREATE TABLE Buyer(
    buyerID INTEGER PRIMARY KEY AUTOINCREMENT
);

CREATE TABLE Seller(
    sellerID INTEGER PRIMARY KEY AUTOINCREMENT
);


CREATE TABLE Payment(
    paymentNum INTEGER PRIMARY KEY AUTOINCREMENT,
    bankaccount_ID INTEGER PRIMARY KEY AUTOINCREMENT,
    amount FLOAT NOT NULL,
    types VARCHAR(255) NOT NULL,
    admin_message VARCHAR(255) NOT NULL,
    FOREIGN KEY (bidID) REFERENCES Bid(bidID),
    FOREIGN KEY (buyerID) REFERENCES Buyer(buyerID),
    FOREIGN KEY (sellerID) REFERENCES Seller(sellerID)
);

CREATE TABLE Bank(
    bankaccount_ID INTEGER PRIMARY KEY AUTOINCREMENT,
    location VARCHAR(255) NOT NULL,
    name VARCHAR(255) NOT NULL,
    FOREIGN KEY (paymentNum) REFERENCES Payment(paymentNum),
    FOREIGN KEY (bankaccount_ID) REFERENCES Payment(bankaccount_ID)
);

CREATE TABLE Bid(
    bidID INTEGER PRIMARY KEY AUTOINCREMENT,
    bidType VARCHAR(255) NOT NULL,
    bidID INTEGER NOT NULL,
    submit BOOLEAN NOT NULL,
    expirationDate DATETIME NOT NULL,
    status VARCHAR(255) NOT NULL,
    FOREIGN KEY (buyerID) REFERENCES Buyer(buyerID),
    FOREIGN KEY (trade_ID) REFERENCES Trade(trade_ID)
);

CREATE TABLE Trade(
    trade_ID INTEGER PRIMARY KEY AUTOINCREMENT,
    date VARCHAR(255) NOT NULL,
    price VARCHAR(255) NOT NULL,
    FOREIGN KEY (buyerID) REFERENCES Buyer(buyerID),
    FOREIGN KEY (sellerID) REFERENCES Seller(sellerID)
);

CREATE TABLE DirectBuy(
    FOREIGN KEY trade_ID REFERENCES Trade(trade_ID) PRIMARY KEY,
    FOREIGN KEY buyerID REFERENCES Buyer(buyerID) PRIMARY KEY,
    autobuy_price VARCHAR(255) NOT NULL
);

CREATE TABLE FlightTrades(
    FOREIGN KEY trade_ID REFERENCES Trade(trade_ID) PRIMARY KEY,
    FOREIGN KEY tripID REFERENCES Flights(tripID) PRIMARY KEY,
);

CREATE TABLE Flights(
    tripID INTEGER PRIMARY KEY AUTOINCREMENT,
    datePosted DATETIME NOT NULL,
    airline_message VARCHAR(255) NOT NULL,
    special_requests VARCHAR(255) NOT NULL,
    FOREIGN KEY bidID REFERENCES Bid(bidID),
    FOREIGN KEY trade_ID REFERENCES Trade(trade_ID),
    FOREIGN KEY buyerID REFERENCES Buyer(buyerID),
    FOREIGN KEY portfolioID REFERENCES FlightPortfolio(portfolioID),
    FOREIGN KEY adminID REFERENCES Admin(adminID)
);

CREATE TABLE FlightPortfolio(
    portfolioID INTEGER PRIMARY KEY AUTOINCREMENT,
    portfolio_name VARCHAR(255) NOT NULL,
    FOREIGN KEY adminID REFERENCES Admin(adminID),
    FOREIGN KEY userID REFERENCES User(userID)
);

CREATE TABLE Departures(
    d_num INTEGER PRIMARY KEY AUTOINCREMENT,
    date_purchased DATETIME NOT NULL,
    airline VARCHAR(255) NOT NULL,
    country VARCHAR(255) NOT NULL,
    continent VARCHAR(255) NOT NULL,
    is_layover boolean,
    airport_code VARCHAR(255) NOT NULL,
    purchased_price VARCHAR(255) NOT NULL,
    current_price VARCHAR(255) NOT NULL,
    asking_price VARCHAR(255) NOT NULL
);

CREATE TABLE Returns(
    r_num INTEGER PRIMARY KEY AUTOINCREMENT,
    date_purchased VARCHAR(255) NOT NULL,
    airline VARCHAR(255) NOT NULL,
    country VARCHAR(255) NOT NULL,
    continent VARCHAR(255) NOT NULL,
    is_layover boolean,
    airport_code VARCHAR(255) NOT NULL,
    purchased_price VARCHAR(255) NOT NULL,
    current_price VARCHAR(255) NOT NULL,
    asking_price VARCHAR(255) NOT NULL
);

CREATE TABLE DepartureTimes(
    takeoff PRIMARY KEY AUTOINCREMENT,
    land PRIMARY KEY AUTOINCREMENT,
    FOREIGN KEY d_num REFERENCES Departures(d_num) PRIMARY KEY
);

CREATE TABLE ReturnTimes(
    takeoff PRIMARY KEY AUTOINCREMENT,
    land PRIMARY KEY AUTOINCREMENT,
    FOREIGN KEY r_num REFERENCES Returns(r_num) PRIMARY KEY
);

CREATE TABLE ReturnFlights(
    FOREIGN KEY r_num REFERENCES Returns(r_num) PRIMARY KEY,
    FOREIGN KEY tripID REFERENCES Flights(tripID) PRIMARY KEY

);

CREATE TABLE DepartingFlights(
    FOREIGN KEY d_num REFERENCES Departures(r_num) PRIMARY KEY,
    FOREIGN KEY tripID REFERENCES Flights(tripID) PRIMARY KEY
);

CREATE TABLE UserLogin(
    loginID PRIMARY KEY AUTOINCREMENT,
    username VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    FOREIGN KEY userID REFERENCES User(userID)
);

CREATE TABLE AdminLogin(
    loginID PRIMARY KEY AUTOINCREMENT,
    username VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    FOREIGN KEY adminID REFERENCES Admin(adminID)
);

CREATE TABLE Admin(
    adminID INTEGER PRIMARY KEY AUTOINCREMENT,
    birthdate VARCHAR(255) NOT NULL,
    firstName VARCHAR(255) NOT NULL,
    lastName VARCHAR(255) NOT NULL,
    phone VARCHAR(255) NOT NULL,
    email VARCHAR(255) NOT NULL,
    pemissions VARCHAR(255) NOT NULL,
    gender VARCHAR(255) NOT NULL,
);

CREATE TABLE CustomerSupport(
    complaintID INTEGER PRIMARY KEY AUTOINCREMENT,
    message VARCHAR(255) NOT NULL,
    FOREIGN KEY userID REFERENCES User(userID)
    FOREIGN KEY adminID REFERENCES Admin(adminID)
);






